BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "path" (
	"phId"	TEXT NOT NULL,
	"phFull"	TEXT NOT NULL,
	PRIMARY KEY("phId")
);
CREATE TABLE IF NOT EXISTS "records" (
	"id"	INTEGER NOT NULL,
	"time"	TEXT NOT NULL,
	"exibitId"	INTEGER NOT NULL,
	"timeSpentInFrontSec"	INTEGER NOT NULL,
	"visualFeedback"	INTEGER NOT NULL,
	"description"	INTEGER NOT NULL,
	"completeness"	INTEGER NOT NULL,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "blob" (
	"blobs"	BLOB NOT NULL
);
CREATE TABLE IF NOT EXISTS "exibit" (
	"exId"	INTEGER NOT NULL,
	"exName"	TEXT NOT NULL,
	"exIdroom"	INTEGER NOT NULL,
	"z1"	TEXT NOT NULL,
	"z2"	TEXT NOT NULL,
	"z3"	TEXT NOT NULL,
	"z4"	TEXT NOT NULL,
	"z5"	TEXT NOT NULL,
	"z6"	TEXT NOT NULL,
	"z7"	TEXT NOT NULL,
	"z8"	TEXT NOT NULL,
	PRIMARY KEY("exId")
);
CREATE TABLE IF NOT EXISTS "users" (
	"id"	INTEGER NOT NULL,
	"username"	TEXT NOT NULL,
	"firstname"	TEXT NOT NULL,
	"psw"	TEXT NOT NULL,
	"time"	TEXT NOT NULL,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "feedback" (
	"id"	INTEGER NOT NULL,
	"username"	TEXT NOT NULL,
	"email"	TEXT NOT NULL,
	"text"	TEXT NOT NULL,
	"time"	TEXT NOT NULL,
	PRIMARY KEY("id")
);
COMMIT;
